import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import PropTypes from 'prop-types';

function Email({ detail }) {
    return (
        <div>
            <div>
                <Sender from={detail.from} />
                <Subject subject={detail.sub} />
                <Date date={detail.date} />
            </div>
            <div>
                <Message body={detail.body} />
            </div>
        </div>
    );
}

function Sender({ from }) {
    return <div>{from}</div>;
}
Sender.propTypes = {
    from: PropTypes.string.isRequired
};

function Subject({ subject }) {
    return <div>{subject}</div>;
}
Subject.propTypes = {
    subject: PropTypes.string.isRequired
}

function Date({ date }) {
    return <div>{date}</div>;
}

function Message({ body }) {
    return <div>{body}</div>;
}

let details = {
    from: 'React Newsletter',
    sub: 'React Newsletter - Issue 36',
    date: 'Jul 15',
    body:
        'React Newsletter Issue -36 - July 15th 2016 Read this issue on the web http://react/newsletter.com/issues/36?'
};

ReactDOM.render(<Email detail={details} />, document.getElementById('root'));
